import React,{Component} from 'react';
import TopNavLeft from './TopNavLeft';
import TopNavRight from './TopNavRight';




class TopNav extends Component {
     
    render() {
        return (
            <div className="row top-nav">
                <TopNavLeft className='fab fa-facebook-f' />
                <TopNavLeft className='fab fa-google-plus-g' />
                <TopNavLeft className='fab fa-twitter' />
                <TopNavLeft className='fab fa-linkedin-in' />
                <TopNavLeft className='fab fa-instagram'/>
               <TopNavRight />
            </div>
        )
    };
}
export default TopNav;
